/**
 * Puts dashes where you'd otherwise put a solid line for n units.
 */
export function dashes(n: number) {
    let dashlengthA = 2.5;
    let dashlengthB = 1;
    let output: number[] = [0];
    let sum = 0;
    for (let i = 0; sum <= n; i++) {
        if (i % 2 == 0) { sum = sum + dashlengthA; output.push(dashlengthA); }
        if (i % 2 == 1) { sum = sum + dashlengthB; output.push(dashlengthB); }
    }
    if (sum > n) {
        output.pop();
        output.push(sum - n);
    }
    if (output.length % 2 == 1) {
        output.push(0);
    }
    return output.join(",");
}

